import './Header.css';

const Header = () => {
    return(
        <header>
            <h1>Nabid Kabir</h1>
            <nav>
                <ul>
                    <li>Home</li>
                    <li>About</li>
                    <li>Projects</li>
                </ul>
            </nav>
        </header>
    );
}

export default Header;
